import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#967bb6', // This is just an example of dark lavender
    },
    text: {
      primary: '#967bb6', // Dark lavender for text
    }
  },
  typography: {
    fontFamily: 'Figtree, Arial, sans-serif',
    button: {
      textTransform: 'none',
    },
  },
});


export default theme;
